INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1001, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1002, 0, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1003, 0, "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 1, "少しは磨かれると思いますよ。", "士条 怜", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1004, 0, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 1, "みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1006, 0, "風宮あかりです", "ねぇ…", 1, "私といっしょに…\nいかない？", "風宮 あかり", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1007, 0, "出雲宮子なのー", "プリンたべたいのー", 1, "食べ物の恨みは怖いのー", "出雲 宮子", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1008, 0, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "いいよ。\n見られることは運命さ…", "虹村 雪", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1009, 0, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "人呼んで「疾風の冥姫」!!", "柊杏奈", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1010, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "ほんまおおきにやわ～♪", "姫宮 真歩", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1011, 0, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 1, "ここで会ったが\n100年目～！", "衣之咲 璃乃", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1012, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 1, "…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1016, 0, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1017, 0, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 1, "でも、沖縄もとってもいいとこさー", "喜屋武 香織", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1018, 0, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 1, "イオちゃんって呼んでね。", "支倉 伊緒", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1020, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 1, "ミミをおいてかないでぇ～", "茜 ミミ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1021, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 1, "ふぇぇぇぇぇん……", "栗林 くるみ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1022, 0, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 1, "なんてありがとうございます！", "風宮 より", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1023, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 1, "私こっち行きたいー\nね、早く早くー", "北条 綾音", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1025, 0, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 1, "これて何か違う…\nあああすみません！", "天野 すずめ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1027, 0, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 1, "離しませんわ………\n絶対に…!!", "倉石 恵理子", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1028, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "…そうでしょ？？", "佐々木 咲恋", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1029, 0, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 1, "あはは、\n私もまだまだだなぁ～", "桜井 望", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1030, 0, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 1, "ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1031, 0, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 1, "おかしいですね……", "上喜 しのぶ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1033, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 1, "そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1034, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 1, "ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1036, 0, "氷川鏡華…です", "知らない人とは話しちゃいけないので", 1, "これ以上お話しすることは…\nないです！", "氷川 鏡華", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1038, 0, "柏崎…栞です。", "……あ、アラーム。", 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1040, 0, "ふ、双葉碧です。", "私、一人も友達がいなくて……", 1, "野に咲く花が、\n唯一の話相手です。", "双葉 碧", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1042, 0, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "そう思っています。", "三角 千歌", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1043, 0, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 1, "う、疑ってすまなかったな…", "安芸 真琴", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1044, 0, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1045, 0, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 1, "ｌク、クウカに何かご用ですか!?", "遠見 空花", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1046, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1048, 0, "大神美冬よ！", "それでは早速クエストに…", 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1049, 0, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1050, 0, "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.4, 1052, 0, "？？？", "？？？？", 1, "？？？？", "リマ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1053, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 1, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィント", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1058, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 1, "そ、そこまでいうなら\nもらってやる", "ペコリーヌ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1059, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 1, "そ、そこまでいうなら\nもらってやる", "コッコロ", 1);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 1, 0, 0, 0, 2, 1.5, 1060, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 1, "そ、そこまでいうなら\nもらってやる", "キャル", 1);
